import React, { Component } from 'react';
import { Table, Button } from 'reactstrap';
//import './App.css';

class App extends Component {

  render() {
    return (
      <div className="App container">
        <Table>
          <thead>
            <tr>
              <th>#</th>
              <th>Title</th>
              <th>Author</th>
              <th>Actions</th>

            </tr>
          </thead>

          <tbody>

            <tr>

              <td>1</td>
              <td>Book title</td>
              <td>2.5</td>
              <td>
                <Button color="succes" size="sm" className="mr-5">Edit</Button>
                <Button color="danger" size="sm">Delete</Button>
              </td>
            </tr>
          </tbody>
        </Table>
      </div>
    )
  }
}

export default App;
